/* VCD dumping functions */
MOD_mkSimBRAMUARTTest & mkSimBRAMUARTTest_backing(tSimStateHdl simHdl)
{
  static MOD_mkSimBRAMUARTTest *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkSimBRAMUARTTest(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkSimBRAMUARTTest::dump_VCD_defs()
{
  (mkSimBRAMUARTTest_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkSimBRAMUARTTest::dump_VCD(tVCDDumpType dt)
{
  (mkSimBRAMUARTTest_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkSimBRAMUARTTest_backing(sim_hdl));
}
